const Count = () => {
    return (  
    <div className = "count">
        <div className = "count__controls">
            <button type = "button" className = "count__decrement">
                <img src="./img/decrement.svg" alt = "-" />
            </button>
            <div className = "count__box">
                <input className = "count__input" type = "number" min = "1" max = "10" value = "1"/>
            </div>
            <button type = "button" className = "count__increment">
                <img src="./img/increment.svg" alt = "+" />
            </button>
        </div>
    </div> 
    );
}

export default Count;
